import{_ as r,c as t,o as a,ae as i}from"./chunks/framework.ByZK1MkX.js";const g=JSON.parse('{"title":"Records","description":"","frontmatter":{},"headers":[],"relativePath":"user-guide/records.md","filePath":"user-guide/records.md"}'),o={name:"user-guide/records.md"};function s(l,e,n,d,c,h){return a(),t("div",null,e[0]||(e[0]=[i(`<h1 id="records" tabindex="-1">Records <a class="header-anchor" href="#records" aria-label="Permalink to &quot;Records&quot;">​</a></h1><p>This page contains detailed information about managing records in SCIENTRY.</p><h2 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-label="Permalink to &quot;Overview&quot;">​</a></h2><p>Records are the actual data entries in SCIENTRY that follow the structure defined by your models. Each record contains values for the attributes defined in its model and can be linked to records in other models through reference relationships.</p><h3 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to &quot;Key Features&quot;">​</a></h3><ul><li>Create and manage data records</li><li>Import records from TSV files</li><li>Edit records inline</li><li>Filter and search records</li><li>Generate charts and visualizations</li><li>Export records to various formats</li><li>Link records across models</li></ul><h2 id="understanding-records" tabindex="-1">Understanding Records <a class="header-anchor" href="#understanding-records" aria-label="Permalink to &quot;Understanding Records&quot;">​</a></h2><h3 id="record-structure" tabindex="-1">Record Structure <a class="header-anchor" href="#record-structure" aria-label="Permalink to &quot;Record Structure&quot;">​</a></h3><p>Each record in SCIENTRY contains:</p><ol><li><p><strong>System Fields</strong> (automatically managed):</p><ul><li><strong>item_id</strong>: Unique identifier for the record</li><li><strong>model_name</strong>: The model this record belongs to</li><li><strong>project_id</strong>: The project containing this record</li><li><strong>reference_id</strong>: Link to a parent record (if applicable)</li><li><strong>created_by</strong>: User who created the record</li><li><strong>created</strong>: Timestamp of creation</li></ul></li><li><p><strong>Dynamic Fields</strong> (defined by your model):</p><ul><li>All the attributes you defined in your model</li><li>Values that match the field types (text, number, date, select)</li></ul></li></ol><h3 id="record-relationships" tabindex="-1">Record Relationships <a class="header-anchor" href="#record-relationships" aria-label="Permalink to &quot;Record Relationships&quot;">​</a></h3><p>Records can be linked together through model relationships:</p><h4 id="parent-child-relationships" tabindex="-1">Parent-Child Relationships <a class="header-anchor" href="#parent-child-relationships" aria-label="Permalink to &quot;Parent-Child Relationships&quot;">​</a></h4><p>When a model references another model, records in the child model can link to records in the parent model:</p><ul><li><strong>Reference Field</strong>: The <code>reference_id</code> field contains the <code>item_id</code> of the parent record</li><li><strong>Validation</strong>: The system ensures the referenced record exists</li><li><strong>Inheritance</strong>: If ID inheritance is enabled, the child record&#39;s ID includes the parent&#39;s ID</li></ul><h4 id="example-relationship" tabindex="-1">Example Relationship <a class="header-anchor" href="#example-relationship" aria-label="Permalink to &quot;Example Relationship&quot;">​</a></h4><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Sample Model (Parent):</span></span>
<span class="line"><span>- item_id: &quot;S001&quot;</span></span>
<span class="line"><span>- sample_name: &quot;Blood Sample A&quot;</span></span>
<span class="line"><span>- collection_date: &quot;2024-01-15&quot;</span></span>
<span class="line"><span></span></span>
<span class="line"><span>Experiment Model (Child):</span></span>
<span class="line"><span>- item_id: &quot;S001_E001&quot;  (inherited from Sample)</span></span>
<span class="line"><span>- reference_id: &quot;S001&quot;  (links to Sample record)</span></span>
<span class="line"><span>- experiment_type: &quot;PCR&quot;</span></span>
<span class="line"><span>- temperature: 25.5</span></span></code></pre></div><h3 id="record-identifiers" tabindex="-1">Record Identifiers <a class="header-anchor" href="#record-identifiers" aria-label="Permalink to &quot;Record Identifiers&quot;">​</a></h3><p>Record identifiers are constructed based on your model&#39;s ID format:</p><ul><li><strong>Single Field</strong>: If your model uses one field for ID (e.g., &quot;sample_id&quot;)</li><li><strong>Multiple Fields</strong>: If your model combines multiple fields (e.g., &quot;sample_id&quot; + &quot;collection_date&quot;)</li><li><strong>Inherited IDs</strong>: If the model references another model with ID inheritance enabled</li></ul><h2 id="creating-records" tabindex="-1">Creating Records <a class="header-anchor" href="#creating-records" aria-label="Permalink to &quot;Creating Records&quot;">​</a></h2><h3 id="manual-record-creation" tabindex="-1">Manual Record Creation <a class="header-anchor" href="#manual-record-creation" aria-label="Permalink to &quot;Manual Record Creation&quot;">​</a></h3><ol><li><strong>Navigate to Records</strong>: Go to your model&#39;s Records tab</li><li><strong>Add Record</strong>: Click the &quot;Add Record&quot; button</li><li><strong>Fill Fields</strong>: Enter values for all required fields and any optional fields</li><li><strong>Reference Validation</strong>: If the model references another model: <ul><li>Enter a valid <code>reference_id</code> that exists in the parent model</li><li>The system will validate the reference before saving</li></ul></li><li><strong>Save</strong>: Click &quot;Save&quot; to create the record</li></ol><h3 id="required-vs-optional-fields" tabindex="-1">Required vs Optional Fields <a class="header-anchor" href="#required-vs-optional-fields" aria-label="Permalink to &quot;Required vs Optional Fields&quot;">​</a></h3><ul><li><strong>Required Fields</strong>: Must have values</li><li><strong>Optional Fields</strong>: Can be left empty</li><li><strong>ID Fields</strong>: Fields used in the record identifier are automatically required</li></ul><h3 id="reference-field-handling" tabindex="-1">Reference Field Handling <a class="header-anchor" href="#reference-field-handling" aria-label="Permalink to &quot;Reference Field Handling&quot;">​</a></h3><p>When creating records in a model that references another model:</p><ol><li><strong>Reference Required</strong>: You must provide a valid <code>reference_id</code></li><li><strong>Validation</strong>: The system checks that the referenced record exists</li><li><strong>Auto-completion</strong>: The interface may suggest existing reference IDs</li><li><strong>Error Handling</strong>: Invalid references will show an error message</li></ol><h2 id="importing-records-from-tsv" tabindex="-1">Importing Records from TSV <a class="header-anchor" href="#importing-records-from-tsv" aria-label="Permalink to &quot;Importing Records from TSV&quot;">​</a></h2><h3 id="tsv-file-format" tabindex="-1">TSV File Format <a class="header-anchor" href="#tsv-file-format" aria-label="Permalink to &quot;TSV File Format&quot;">​</a></h3><p>TSV (Tab-Separated Values) files are a convenient way to import multiple records at once.</p><h4 id="file-requirements" tabindex="-1">File Requirements <a class="header-anchor" href="#file-requirements" aria-label="Permalink to &quot;File Requirements&quot;">​</a></h4><ul><li><strong>Format</strong>: Tab-separated values (not comma-separated)</li><li><strong>Headers</strong>: First row should contain column names, column names must be mapped to the model&#39;s attribute definition, use the auto-assign button for faster mapping</li><li><strong>Encoding</strong>: UTF-8 encoding recommended</li></ul><h4 id="example-tsv-file" tabindex="-1">Example TSV File <a class="header-anchor" href="#example-tsv-file" aria-label="Permalink to &quot;Example TSV File&quot;">​</a></h4><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>sample_id	collection_date	location	temperature	notes</span></span>
<span class="line"><span>S001	2024-01-15	Lab A	25.5	First batch</span></span>
<span class="line"><span>S002	2024-01-16	Lab B	24.8	Second batch</span></span>
<span class="line"><span>S003	2024-01-17	Lab A	26.1	Third batch</span></span></code></pre></div><h3 id="import-process" tabindex="-1">Import Process <a class="header-anchor" href="#import-process" aria-label="Permalink to &quot;Import Process&quot;">​</a></h3><ol><li><strong>Prepare File</strong>: Create your TSV file with headers matching model fields</li><li><strong>Upload</strong>: Click &quot;Import TSV&quot; in the Records tab</li><li><strong>File Selection</strong>: Choose your TSV file</li><li><strong>Column Mapping</strong>: Map TSV columns to model fields: <ul><li><strong>Auto-mapping</strong>: System attempts to match column names to field names</li><li><strong>Manual mapping</strong>: You can manually select which column maps to which field</li><li><strong>Skip columns</strong>: You can skip columns that don&#39;t correspond to model fields</li></ul></li><li><strong>Reference Mapping</strong>: If your model references another model: <ul><li>Map the reference column to the appropriate parent model field</li><li>Ensure reference values exist in the parent model</li></ul></li><li><strong>Validation</strong>: System validates data before import</li><li><strong>Import</strong>: Click &quot;Import&quot; to create the records</li></ol><h3 id="import-validation" tabindex="-1">Import Validation <a class="header-anchor" href="#import-validation" aria-label="Permalink to &quot;Import Validation&quot;">​</a></h3><p>The system validates imported data for:</p><ul><li><strong>Required Fields</strong>: All required fields must have values</li><li><strong>Data Types</strong>: Values must match field types (text, number, date)</li><li><strong>References</strong>: Reference IDs must exist in parent models</li><li><strong>Unique IDs</strong>: Record identifiers must be unique</li><li><strong>Format</strong>: Date fields must be in correct format</li></ul><h3 id="import-results" tabindex="-1">Import Results <a class="header-anchor" href="#import-results" aria-label="Permalink to &quot;Import Results&quot;">​</a></h3><p>After import, you&#39;ll see:</p><ul><li><strong>Success Count</strong>: Number of records successfully imported</li><li><strong>Error Count</strong>: Number of records that failed to import</li><li><strong>Error Details</strong>: Specific errors for failed records</li><li><strong>Preview</strong>: Option to review imported records</li></ul><h2 id="editing-records" tabindex="-1">Editing Records <a class="header-anchor" href="#editing-records" aria-label="Permalink to &quot;Editing Records&quot;">​</a></h2><h3 id="inline-editing" tabindex="-1">Inline Editing <a class="header-anchor" href="#inline-editing" aria-label="Permalink to &quot;Inline Editing&quot;">​</a></h3><p>SCIENTRY supports inline editing for quick record updates:</p><ol><li><strong>Enter Edit Mode</strong>: Click the edit icon next to a record</li><li><strong>Make Changes</strong>: Modify field values directly in the table</li><li><strong>Save Changes</strong>: Click the save icon or press Enter</li><li><strong>Cancel</strong>: Click the cancel icon to discard changes</li></ol><h2 id="filtering-and-searching-records" tabindex="-1">Filtering and Searching Records <a class="header-anchor" href="#filtering-and-searching-records" aria-label="Permalink to &quot;Filtering and Searching Records&quot;">​</a></h2><h3 id="filter-options" tabindex="-1">Filter Options <a class="header-anchor" href="#filter-options" aria-label="Permalink to &quot;Filter Options&quot;">​</a></h3><p>SCIENTRY provides multiple ways to filter records:</p><h4 id="text-filters" tabindex="-1">Text Filters <a class="header-anchor" href="#text-filters" aria-label="Permalink to &quot;Text Filters&quot;">​</a></h4><ul><li><strong>Contains</strong>: Records containing specific text</li><li><strong>Starts with</strong>: Records starting with specific text</li><li><strong>Ends with</strong>: Records ending with specific text</li><li><strong>Exact match</strong>: Records exactly matching the text</li></ul><h4 id="number-filters" tabindex="-1">Number Filters <a class="header-anchor" href="#number-filters" aria-label="Permalink to &quot;Number Filters&quot;">​</a></h4><ul><li><strong>Equals</strong>: Records with exact number value</li><li><strong>Greater than</strong>: Records with values above threshold</li><li><strong>Less than</strong>: Records with values below threshold</li><li><strong>Range</strong>: Records within a value range</li></ul><h4 id="date-filters" tabindex="-1">Date Filters <a class="header-anchor" href="#date-filters" aria-label="Permalink to &quot;Date Filters&quot;">​</a></h4><ul><li><strong>On date</strong>: Records created on specific date</li><li><strong>Before date</strong>: Records created before date</li><li><strong>After date</strong>: Records created after date</li><li><strong>Date range</strong>: Records within date range</li></ul><h4 id="reference-filters" tabindex="-1">Reference Filters <a class="header-anchor" href="#reference-filters" aria-label="Permalink to &quot;Reference Filters&quot;">​</a></h4><ul><li><strong>Has reference</strong>: Records that reference a specific parent record</li><li><strong>No reference</strong>: Records without any reference</li><li><strong>Reference type</strong>: Records referencing specific types of parent records</li></ul><h3 id="advanced-filtering" tabindex="-1">Advanced Filtering <a class="header-anchor" href="#advanced-filtering" aria-label="Permalink to &quot;Advanced Filtering&quot;">​</a></h3><h4 id="multiple-filters" tabindex="-1">Multiple Filters <a class="header-anchor" href="#multiple-filters" aria-label="Permalink to &quot;Multiple Filters&quot;">​</a></h4><ul><li><strong>Combine filters</strong>: Use multiple filters simultaneously</li><li><strong>AND logic</strong>: All filters must be true for a record to be shown</li><li><strong>OR logic</strong>: Any filter can be true for a record to be shown</li></ul><h4 id="filter-presets" tabindex="-1">Filter Presets <a class="header-anchor" href="#filter-presets" aria-label="Permalink to &quot;Filter Presets&quot;">​</a></h4><ul><li><strong>Save filters</strong>: Save commonly used filter combinations</li><li><strong>Quick access</strong>: Access saved filters from dropdown</li><li><strong>Share filters</strong>: Share filter presets with team members</li></ul><h3 id="search-functionality" tabindex="-1">Search Functionality <a class="header-anchor" href="#search-functionality" aria-label="Permalink to &quot;Search Functionality&quot;">​</a></h3><h4 id="field-specific-search" tabindex="-1">Field-Specific Search <a class="header-anchor" href="#field-specific-search" aria-label="Permalink to &quot;Field-Specific Search&quot;">​</a></h4><ul><li><strong>Search specific fields</strong>: Focus search on particular fields</li><li><strong>Exact matching</strong>: Search for exact field values</li><li><strong>Pattern matching</strong>: Use wildcards and patterns</li></ul><h2 id="charts-and-visualizations" tabindex="-1">Charts and Visualizations <a class="header-anchor" href="#charts-and-visualizations" aria-label="Permalink to &quot;Charts and Visualizations&quot;">​</a></h2><h3 id="available-chart-types" tabindex="-1">Available Chart Types <a class="header-anchor" href="#available-chart-types" aria-label="Permalink to &quot;Available Chart Types&quot;">​</a></h3><p>SCIENTRY supports various chart types for data visualization:</p><h4 id="bar-charts" tabindex="-1">Bar Charts <a class="header-anchor" href="#bar-charts" aria-label="Permalink to &quot;Bar Charts&quot;">​</a></h4><ul><li><strong>Horizontal bars</strong>: Compare values with long category names</li></ul><h4 id="line-charts" tabindex="-1">Line Charts <a class="header-anchor" href="#line-charts" aria-label="Permalink to &quot;Line Charts&quot;">​</a></h4><ul><li><strong>Time series</strong>: Track changes over time</li></ul><h4 id="pie-charts" tabindex="-1">Pie Charts <a class="header-anchor" href="#pie-charts" aria-label="Permalink to &quot;Pie Charts&quot;">​</a></h4><ul><li><strong>Proportions</strong>: Show parts of a whole</li><li><strong>Percentages</strong>: Display percentage distributions</li><li><strong>Categories</strong>: Compare categorical data</li></ul><h4 id="doughnut-charts" tabindex="-1">Doughnut Charts <a class="header-anchor" href="#doughnut-charts" aria-label="Permalink to &quot;Doughnut Charts&quot;">​</a></h4><ul><li><strong>Similar to pie</strong>: Show proportions with center space</li><li><strong>Multiple rings</strong>: Show hierarchical data</li></ul><h3 id="creating-charts" tabindex="-1">Creating Charts <a class="header-anchor" href="#creating-charts" aria-label="Permalink to &quot;Creating Charts&quot;">​</a></h3><ol><li><strong>Select Data</strong>: Choose the records and fields for your chart</li><li><strong>Chart Type</strong>: Select the appropriate chart type</li><li><strong>Filters</strong>: Apply filters to focus on specific data</li><li><strong>Generate</strong>: Create and display the chart</li></ol><h3 id="interactive-features" tabindex="-1">Interactive Features <a class="header-anchor" href="#interactive-features" aria-label="Permalink to &quot;Interactive Features&quot;">​</a></h3><h4 id="chart-interactions" tabindex="-1">Chart Interactions <a class="header-anchor" href="#chart-interactions" aria-label="Permalink to &quot;Chart Interactions&quot;">​</a></h4><ul><li><strong>Hover details</strong>: See detailed information on hover</li><li><strong>Click actions</strong>: Click on chart elements for more details</li><li><strong>Zoom</strong>: Zoom in on specific chart areas</li><li><strong>Pan</strong>: Navigate around large charts</li></ul><h4 id="export-options" tabindex="-1">Export Options <a class="header-anchor" href="#export-options" aria-label="Permalink to &quot;Export Options&quot;">​</a></h4><ul><li><strong>Image export</strong>: Save charts as PNG, JPG, or SVG</li><li><strong>Data export</strong>: Export chart data as CSV or TSV</li><li><strong>Embed</strong>: Get embed codes for external use</li></ul><h2 id="record-management" tabindex="-1">Record Management <a class="header-anchor" href="#record-management" aria-label="Permalink to &quot;Record Management&quot;">​</a></h2><h3 id="record-operations" tabindex="-1">Record Operations <a class="header-anchor" href="#record-operations" aria-label="Permalink to &quot;Record Operations&quot;">​</a></h3><h4 id="viewing-records" tabindex="-1">Viewing Records <a class="header-anchor" href="#viewing-records" aria-label="Permalink to &quot;Viewing Records&quot;">​</a></h4><ul><li><strong>Table view</strong>: View records in a sortable table</li><li><strong>Card view</strong>: View records as individual cards</li><li><strong>Detail view</strong>: View complete record information</li><li><strong>Related records</strong>: View records linked to the current record</li></ul><h4 id="record-actions" tabindex="-1">Record Actions <a class="header-anchor" href="#record-actions" aria-label="Permalink to &quot;Record Actions&quot;">​</a></h4><ul><li><strong>Edit</strong>: Modify record values</li><li><strong>Delete</strong>: Remove records (with confirmation)</li><li><strong>Duplicate</strong>: Create a copy of a record</li><li><strong>Export</strong>: Export individual records</li></ul><h3 id="data-export" tabindex="-1">Data Export <a class="header-anchor" href="#data-export" aria-label="Permalink to &quot;Data Export&quot;">​</a></h3><h4 id="export-formats" tabindex="-1">Export Formats <a class="header-anchor" href="#export-formats" aria-label="Permalink to &quot;Export Formats&quot;">​</a></h4><ul><li><strong>TSV</strong>: Tab-separated values for spreadsheet applications</li></ul><h4 id="export-options-1" tabindex="-1">Export Options <a class="header-anchor" href="#export-options-1" aria-label="Permalink to &quot;Export Options&quot;">​</a></h4><ul><li><strong>All records</strong>: Export all records in the model</li><li><strong>Filtered records</strong>: Export only filtered records</li><li><strong>Field selection</strong>: Choose which fields to include</li></ul><h3 id="record-history" tabindex="-1">Record History <a class="header-anchor" href="#record-history" aria-label="Permalink to &quot;Record History&quot;">​</a></h3><h4 id="audit-trail" tabindex="-1">Audit Trail <a class="header-anchor" href="#audit-trail" aria-label="Permalink to &quot;Audit Trail&quot;">​</a></h4><ul><li><strong>Creation</strong>: Track when and by whom records were created</li><li><strong>Modifications</strong>: Track all changes to records</li><li><strong>Deletions</strong>: Track record deletions</li></ul><h2 id="best-practices" tabindex="-1">Best Practices <a class="header-anchor" href="#best-practices" aria-label="Permalink to &quot;Best Practices&quot;">​</a></h2><h3 id="data-entry" tabindex="-1">Data Entry <a class="header-anchor" href="#data-entry" aria-label="Permalink to &quot;Data Entry&quot;">​</a></h3><ul><li><strong>Consistency</strong>: Use consistent formats for similar data</li><li><strong>Validation</strong>: Check data before saving</li><li><strong>Documentation</strong>: Add notes for unusual values</li><li><strong>Backup</strong>: Export important data regularly</li></ul><h3 id="importing-data" tabindex="-1">Importing Data <a class="header-anchor" href="#importing-data" aria-label="Permalink to &quot;Importing Data&quot;">​</a></h3><ul><li><strong>Clean data</strong>: Ensure data is clean before import</li><li><strong>Test imports</strong>: Test with small datasets first</li><li><strong>Backup</strong>: Backup existing data before large imports</li><li><strong>Validation</strong>: Review import results carefully</li></ul><h3 id="filtering-and-analysis" tabindex="-1">Filtering and Analysis <a class="header-anchor" href="#filtering-and-analysis" aria-label="Permalink to &quot;Filtering and Analysis&quot;">​</a></h3><ul><li><strong>Start broad</strong>: Begin with broad filters and narrow down</li><li><strong>Save filters</strong>: Save useful filter combinations</li><li><strong>Document analysis</strong>: Keep notes on analysis steps</li><li><strong>Share insights</strong>: Share findings with team members</li></ul><h3 id="chart-creation" tabindex="-1">Chart Creation <a class="header-anchor" href="#chart-creation" aria-label="Permalink to &quot;Chart Creation&quot;">​</a></h3><ul><li><strong>Choose appropriate type</strong>: Select chart type based on data and goals</li><li><strong>Simplify</strong>: Keep charts simple and focused</li><li><strong>Label clearly</strong>: Use clear, descriptive labels</li><li><strong>Test interactions</strong>: Verify chart interactions work as expected</li></ul><h2 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h2><h3 id="common-issues" tabindex="-1">Common Issues <a class="header-anchor" href="#common-issues" aria-label="Permalink to &quot;Common Issues&quot;">​</a></h3><h4 id="import-problems" tabindex="-1">Import Problems <a class="header-anchor" href="#import-problems" aria-label="Permalink to &quot;Import Problems&quot;">​</a></h4><ul><li><strong>Encoding issues</strong>: Ensure files are UTF-8 encoded</li><li><strong>Format problems</strong>: Check that files are tab-separated</li><li><strong>Missing fields</strong>: Ensure all required fields are present</li><li><strong>Invalid references</strong>: Verify reference IDs exist in parent models</li></ul><h4 id="editing-issues" tabindex="-1">Editing Issues <a class="header-anchor" href="#editing-issues" aria-label="Permalink to &quot;Editing Issues&quot;">​</a></h4><ul><li><strong>Cannot edit field</strong>: Check if field is read-only or part of ID</li><li><strong>Validation errors</strong>: Review field requirements and data types</li><li><strong>Reference errors</strong>: Ensure referenced records exist</li></ul><h4 id="filter-problems" tabindex="-1">Filter Problems <a class="header-anchor" href="#filter-problems" aria-label="Permalink to &quot;Filter Problems&quot;">​</a></h4><ul><li><strong>No results</strong>: Check filter criteria and data</li><li><strong>Slow performance</strong>: Use more specific filters</li><li><strong>Unexpected results</strong>: Review filter logic and combinations</li></ul><h3 id="getting-help" tabindex="-1">Getting Help <a class="header-anchor" href="#getting-help" aria-label="Permalink to &quot;Getting Help&quot;">​</a></h3><p>If you encounter issues with records:</p><ol><li><strong>Check documentation</strong>: Review field requirements and data types</li><li><strong>Validate data</strong>: Ensure data meets model requirements</li><li><strong>Test with small datasets</strong>: Use small datasets for testing</li><li><strong>Contact support</strong>: Reach out to your system administrator</li></ol><h2 id="summary" tabindex="-1">Summary <a class="header-anchor" href="#summary" aria-label="Permalink to &quot;Summary&quot;">​</a></h2><p>Records are the core data elements in SCIENTRY. Understanding how to create, edit, filter, and visualize records effectively will help you manage your research data efficiently. Always validate your data and use appropriate tools for your specific needs.</p>`,120)]))}const p=r(o,[["render",s]]);export{g as __pageData,p as default};
